INSERT INTO `t_kng_knowledge` (`id`, `code`, `name`, `state`, `description`, `ext_1`, `ext_2`, `ext_3`, `ext_4`, `meta_created`, `meta_updated`, `meta_logic_flag`) VALUES
	(1, 'Type selectors', '元素选择器', 1, 'div', '', '', '', '', '2019-09-26 20:20:41', '2019-09-26 20:20:41', 1),
	(2, 'Type selector-Namespaces', '元素选择器-命名空间', 1, 'ns | div', '', '', '', '', '2019-09-26 20:23:15', '2019-09-26 20:23:15', 1),
	(3, 'Class selector', '类选择器', 1, '.classname', '', '', '', '', '2019-09-26 20:25:02', '2019-09-26 20:25:02', 1),
	(4, 'ID selector', 'ID 选择器', 1, '#idname', '', '', '', '', '2019-09-26 20:26:13', '2019-09-26 20:26:13', 1),
	(5, 'Universal selector', '通配选择器', 1, '*', '', '', '', '', '2019-09-26 20:43:31', '2019-09-26 20:43:31', 1),
	(6, 'Universal selector-Namespaces', '通配选择器-命名空间', 1, '*|*', '', '', '', '', '2019-09-26 20:44:56', '2019-09-26 20:44:56', 1),
	(7, 'Attribute selectors', '属性选择器', 1, '[attr=value]', '', '', '', '', '2019-09-26 20:47:06', '2019-09-26 20:47:06', 1),
	(8, '', '属性选择器-忽略大小写标识符', 1, 'Attribute selectors-Case-insensitive modifier\n\n[attr=value i]', '', '', '', '', '2019-09-26 20:55:42', '2019-09-26 20:55:42', 1),
	(9, '', '属性选择器-区分大小写标识符', 1, '实验\nAttribute selectors-Case-sensitive modifier\n[attr=value s]\n[type="a" s]', '', '', '', '', '2019-09-26 20:57:14', '2019-09-26 20:57:14', 1),
	(10, 'Adjacent sibling combinator', '相邻兄弟选择器', 1, 'Bug\nInternet Explorer 7: 当将元素动态放置在与选择器匹配的元素之前时，无法正确更新样式。\nInternet Explorer 8: 如果通过单击链接动态插入元素，则在链接失去焦点之前，不会应用第一个子样式。\nA + B', '', '', '', '', '2019-09-26 21:02:52', '2019-09-26 21:02:52', 1),
	(11, 'General sibling combinator', '普通兄弟选择器', 1, 'A ~ B', '', '', '', '', '2019-09-26 21:05:26', '2019-09-26 21:05:26', 1),
	(12, 'Child combinator', '子选择器', 1, 'A > B', '', '', '', '', '2019-09-26 21:08:11', '2019-09-26 21:08:11', 1),
	(13, 'Descendant combinator', '后代选择器', 1, 'A B', '', '', '', '', '2019-09-26 21:13:10', '2019-09-26 21:13:10', 1),
	(14, '', '::after', 1, '创建一个伪元素，作为已选中元素的最后一个子元素\n\na::after {\n  content: "→";\n}\n\nHack 支持非标准名称 :after', '', '', '', '', '2019-09-26 21:37:50', '2019-09-26 21:37:50', 1),
	(15, '', '::after-支持动画和过渡', 1, '创建一个伪元素，作为已选中元素的最后一个子元素 a::after { content: "→"; }\n\nAnimation and transition support(支持动画和过渡)', '', '', '', '', '2019-09-26 21:40:01', '2019-09-26 21:40:01', 1),
	(16, '', '::before', 1, '创建一个伪元素，作为已选中元素的第一个子元素 a::before { content: "→"; }\n\nHack 支持非标准名称 :before', '', '', '', '', '2019-09-26 21:44:35', '2019-09-26 21:44:35', 1),
	(17, '', '::before-支持动画和过渡', 1, '创建一个伪元素，作为已选中元素的第一个子元素 a::before { content: "→"; }\n\nAnimation and transition support(支持动画和过渡)', '', '', '', '', '2019-09-26 21:46:33', '2019-09-26 21:46:33', 1),
	(18, '', '::first-letter', 1, '选中块级元素的第一行的第一个字母\n\np::first-letter {\n  font-size: 130%;\n}\n\nHack支持非标准名称 :first-letter', '', '', '', '', '2019-09-26 21:56:27', '2019-09-26 21:56:27', 1),
	(19, '', '::placeholder', 1, '实验\n选择一个表单元素的占位文本\n\n::placeholder {\n  color: red;\n  font-size: 1.5em;\n}\n\nHack 支持前缀 -webkit-input-\n-moz-', '', '', '', '', '2019-09-27 08:57:00', '2019-09-27 08:57:00', 1),
	(20, '', '::first-line', 1, '选中块级元素的第一行\n\n::first-line {\n  color: blue;\n}\n\nHack 支持非标准属性 :first-line', '', '', '', '', '2019-09-27 09:03:29', '2019-09-27 09:03:29', 1),
	(21, '', '::selection', 1, '匹配高亮（比如使用鼠标或其他选择设备选中的文本）\n\n::selection {\n  background-color: cyan;\n}\n\nfirefox: Hack 支持前缀  -moz-\nfirefox_android: Hack 支持前缀  -moz-', '', '', '', '', '2019-09-27 09:08:14', '2019-09-27 09:08:14', 1),
	(22, '', '::slotted', 1, '匹配放置在HTML模板内的插槽中的任何元素\n\n::slotted(span) {\n  font-weight: bold;\n}', '', '', '', '', '2019-09-27 09:15:36', '2019-09-27 09:15:36', 1),
	(23, '', '::cue', 1, '匹配所选元素中的 WebVTT 提示\n\n::cue {\n  color: yellow;\n  font-weight: bold;\n}', '', '', '', '', '2019-09-27 09:20:58', '2019-09-27 09:20:58', 1),
	(24, '', ':active', 1, 'Bug\nsafari_ios: 默认情况下，不会使用 :active 状态，除非相关元素或<body>元素上有 touchstart 事件处理程序。\n匹配被用户激活的元素\na:active {\n  color: red;\n}', '', '', '', '', '2019-09-26 21:17:46', '2019-09-26 21:17:46', 1),
	(25, '', ':active-支持a元素', 1, 'a:active { color: red; }', '', '', '', '', '2019-09-26 21:23:33', '2019-09-26 21:23:33', 1),
	(26, '', ':any-link', 1, '选择超链接\n\n:any-link {\n  color: green;\n}\n\nHack 支持前缀 -webkit-\nHack 支持前缀 -moz-', '', '', '', '', '2019-09-27 09:59:18', '2019-09-27 09:59:18', 1),
	(27, '', ':checked', 1, '选择 checked 或者 on 状态的 radio、checkbox、option 元素\n\n:checked {\n  margin-left: 25px;\n  border: 1px solid blue;\n}', '', '', '', '', '2019-09-27 10:09:05', '2019-09-27 10:09:05', 1),
	(28, '', ':default', 1, '选择一组表单元素中有默认值的元素\n\ninput:default {\n  box-shadow: 0 0 2px 1px coral;\n}', '', '', '', '', '2019-09-27 10:13:16', '2019-09-27 10:13:16', 1),
	(29, '', ':defined', 1, '选择已定义的任何元素\n\n:defined {\n  font-style: italic;\n}\n\n自定义元素\ncustomElements.define()', '', '', '', '', '2019-09-27 10:32:24', '2019-09-27 10:32:24', 1),
	(30, '', ':disabled', 1, '选择任何禁用的元素\n\ninput:disabled {\n  background: #ccc;\n}\n\nEdge 无法识别 <fieldset> 元素上的 :disabled\nIE 无法识别 <fieldset> 元素上的 :disabled', '', '', '', '', '2019-09-27 10:36:33', '2019-09-27 10:36:33', 1),
	(31, '', ':empty', 1, '选择没有子元素的元素\n\n.box:empty {\n  background: lime;\n}', '', '', '', '', '2019-09-27 10:38:12', '2019-09-27 10:38:12', 1),
	(32, '', ':enabled', 1, '选择任何启用的元素\n\ninput:enabled {\n  color: blue;\n}', '', '', '', '', '2019-09-27 10:39:03', '2019-09-27 10:39:03', 1),
	(33, '', ':first', 1, '与 @page 规则一起使用，代表打印文档的第一页\n\n@page :first {\n  margin-left: 50%;\n  margin-top: 50%;\n}', '', '', '', '', '2019-09-27 10:41:46', '2019-09-27 10:41:46', 1),
	(34, '', ':first-child', 1, '表示一组同级元素中的第一个元素\n\np:first-child {\n  color: lime;\n}\n\nIE7: 动态添加元素时，不会更新 :first-child 的样式\nIE8: 如果通过单击链接动态插入元素，则直到链接失去焦点后，才会应用 :first-child 样式', '', '', '', '', '2019-09-27 10:48:31', '2019-09-27 10:48:31', 1),
	(35, '', ':first-of-type', 1, '表示一组同级元素中指定类型的第一个元素\n\np:first-of-type {\n  color: red;\n}', '', '', '', '', '2019-09-27 10:50:48', '2019-09-27 10:50:48', 1),
	(36, '', ':fullscreen', 1, '匹配当前处于全屏模式的每个元素\n\n#fs-toggle:fullscreen {\n  background-color: #faa;\n}\n\nHack 支持非标准名称 :-webkit-full-screen\nHack 支持非标准名称 :-moz-full-screen\nHack 支持非标准名称 -ms-', '', '', '', '', '2019-09-27 10:57:56', '2019-09-27 10:57:56', 1),
	(37, '', ':focus', 1, '表示已获得焦点的元素（例如表单输入）\n\n.red-input:focus {\n  background: yellow;\n  color: red;\n}', '', '', '', '', '2019-09-27 11:01:09', '2019-09-27 11:01:09', 1),
	(38, '', ':focus-within', 1, '表示已获得焦点的元素或包含已获得焦点的元素\n\ndiv:focus-within {\n  background: cyan;\n}', '', '', '', '', '2019-09-27 11:15:31', '2019-09-27 11:15:31', 1),
	(39, '', ':host', 1, '匹配 shadow DOM 的根元素\n:host {\n  font-weight: bold;\n}', '', '', '', '', '2019-09-26 21:31:07', '2019-09-26 21:31:07', 1),
	(40, '', ':host()', 1, '实验\n选择与参数匹配的 shadow DOM 的根元素\n\n:host(.special-custom-element) {\n  font-weight: bold;\n}\n\nsafari: 某些CSS选择器不起作用，样式化槽位内容有问题\nsafari_ios: 某些CSS选择器不起作用，样式化槽位内容有问题', '', '', '', '', '2019-09-27 09:53:52', '2019-09-27 09:53:52', 1),
	(41, '', ':host-context', 1, '实验\n选择是给定选择器参数的后代的 shadow DOM 的根元素\n:host-context(h1) {\n  font-weight: bold;\n}', '', '', '', '', '2019-09-27 11:25:29', '2019-09-27 11:25:29', 1),
	(42, '', ':hover', 1, '匹配用户正在进行交互的元素，但不一定激活该元素。通常，当用户使用光标（鼠标指针）将鼠标悬停在元素上时触发。\na:hover {\n  color: orange;\n}\n\n已知问题：\nsafari_ios 7.1.2 版本开始: 点击可点击元素会使该元素进入 :hover 状态。元素将保持 :hover 状态，直到其他元素进入 :hover 状态。\nIE8-11、Edge: 将鼠标悬停在元素上，然后在不移动指针的情况下向上或向下滚动，将使该元素处于：hover状态，直到指针被移动为止。\nIE9: 如果 <table> 的父级具有非自动宽度和 overflow-x: auto; 属性，则 <table> 具有足够的内容以使其父级水平溢出，并且在表格中的元素上设置 :hover 样式，然后将鼠标悬停在所述元素上会导致 <table> 的高度增加。该错误的一种解决方法是在<table>的父元素上设置 min-height 为 0％（必须指定％单位，因为无单位和 px 都没用）', '', '', '', '', '2019-09-27 11:52:50', '2019-09-27 11:52:50', 1),
	(43, '', ':hover-支持 <a> 元素', 1, '匹配用户正在进行交互的元素，但不一定激活该元素。通常，当用户使用光标（鼠标指针）将鼠标悬停在元素上时触发。\na:hover {\n  background-color: gold;\n}', '', '', '', '', '2019-09-27 11:56:17', '2019-09-27 11:56:17', 1),
	(44, '', ':hover-支持伪元素', 1, '', '', '', '', '', '2019-09-27 11:57:28', '2019-09-27 11:57:28', 1),
	(45, '', ':indeterminate', 1, '表示状态不确定的任何表单元素，可以作为未填写提示\ninput:indeterminate {\n  background: lime;\n}', '', '', '', '', '2019-09-27 12:01:18', '2019-09-27 12:01:18', 1),
	(46, '', ':indeterminate-支持type="checkbox"', 1, '', '', '', '', '', '2019-09-27 12:02:02', '2019-09-27 12:02:02', 1),
	(47, '', ':indeterminate-支持 <progress> 元素', 1, '', '', '', '', '', '2019-09-27 12:03:05', '2019-09-27 12:03:05', 1),
	(48, '', ':indeterminate-支持 type="radio"', 1, '', '', '', '', '', '2019-09-27 12:04:24', '2019-09-27 12:04:24', 1),
	(49, '', ':in-range', 1, '表示一个 input 元素，其当前值在 min 和 max 属性指定的范围限制内。\ninput:in-range {\n  background-color: rgba(0, 255, 0, 0.25);\n}', '', '', '', '', '2019-09-27 12:08:49', '2019-09-27 12:08:49', 1),
	(50, '', ':invalid', 1, '表示其内容无法通过验证的 input 或其他 form 元素\ninput:invalid {\n  background-color: #ffdddd;\n}', '', '', '', '', '2019-09-27 12:12:05', '2019-09-27 12:12:05', 1),
	(51, '', ':invalid-适用于 <form> 元素', 1, 'form:invalid {\n  border: 5px solid #ffdddd;\n}', '', '', '', '', '2019-09-27 12:13:54', '2019-09-27 12:13:54', 1),
	(52, '', ':lang()', 1, '根据指定的语言来匹配元素\np:lang(en) {\n  quotes: \'\\201C\' \'\\201D\' \'\\2018\' \'\\2019\';\n}', '', '', '', '', '2019-09-27 12:20:16', '2019-09-27 12:20:16', 1),
	(53, '', ':last-child', 1, '表示一组同级元素中的最后一个元素\np:last-child {\n  color: lime;\n}', '', '', '', '', '2019-09-27 12:21:38', '2019-09-27 12:21:38', 1),
	(54, '', ':last-of-type', 1, '表示一组同级元素中指定类型的最后一个元素\np:last-of-type {\n  color: lime;\n}', '', '', '', '', '2019-09-27 12:22:53', '2019-09-27 12:22:53', 1),
	(55, '', ':left', 1, '与 @page 规则一起使用，表示打印文档的所有左侧页面\n@page :left {\n  margin: 2in 3in;\n}', '', '', '', '', '2019-09-27 12:24:43', '2019-09-27 12:24:43', 1),
	(56, '', ':link', 1, '表示尚未访问的元素，它与具有 href 属性的每个未访问的 a，area、link元素匹配\na:link {\n  color: red;\n}', '', '', '', '', '2019-09-27 12:26:43', '2019-09-27 12:26:43', 1),
	(57, '', ':not()', 1, '表示与选择器列表不匹配的元素\n:not(p) {\n  color: blue;\n}', '', '', '', '', '2019-09-27 13:36:36', '2019-09-27 13:36:36', 1),
	(58, '', ':nth-child()', 1, '根据元素在一组兄弟中的位置匹配元素\n:nth-child(4n) {\n  color: lime;\n}\n\nOpera 15之前，Opera 不处理 :nth-​​child() 的动态插入的元素', '', '', '', '', '2019-09-27 13:40:41', '2019-09-27 13:40:41', 1),
	(59, '', ':nth-last-child()', 1, '根据元素在一组兄弟姐妹中的位置（从末尾算起）匹配元素\n:nth-last-child(4n) {\n  color: lime;\n}', '', '', '', '', '2019-09-27 13:49:29', '2019-09-27 13:49:29', 1),
	(60, '', ':nth-last-of-type()', 1, '根据它们在一组同级兄弟中的位置（从末尾算起），匹配给定类型的元素。\nspan:nth-last-of-type(2) {\n  background-color: lime;\n}', '', '', '', '', '2019-09-27 13:52:18', '2019-09-27 13:52:18', 1),
	(61, '', ':nth-of-type()', 1, '根据它们在一组兄弟姐妹中的位置来匹配给定类型的元素。\np:nth-of-type(4n) {\n  color: lime;\n}', '', '', '', '', '2019-09-27 13:53:54', '2019-09-27 13:53:54', 1),
	(62, '', ':only-child', 1, '匹配在父元素中是唯一子元素的元素\n\np:only-child {\n  background-color: lime;\n}', '', '', '', '', '2019-09-27 09:33:14', '2019-09-27 09:33:14', 1),
	(63, '', ':only-of-type', 1, '选择没有同类型兄弟姐妹的元素\n\np:only-of-type {\n  background-color: lime;\n}', '', '', '', '', '2019-09-27 10:02:31', '2019-09-27 10:02:31', 1),
	(66, '', ':out-of-range', 1, '表示一个 input 元素，其当前值超出了 min 和 max 属性指定的范围限制。\ninput:out-of-range {\n  background-color: rgba(255, 0, 0, 0.25);\n}', '', '', '', '', '2019-09-27 14:48:50', '2019-09-27 14:48:50', 1),
	(67, '', ':placeholder-shown', 1, '实验\n表示当前显示占位符文本的任何 input 或 textarea 元素\n:placeholder-shown {\n  border: 2px solid silver;\n}\nHack\nfirefox :-moz-placeholder\nfirefox_android :-moz-placeholder\nie :-ms-input-placeholder', '', '', '', '', '2019-09-27 14:59:10', '2019-09-27 14:59:10', 1),
	(68, '', ':read-only', 1, '表示用户不可编辑的元素\ninput:read-only {\n  background-color: #ccc;\n}\nHack\nfirefox -moz-\nfirefox_android -moz-', '', '', '', '', '2019-09-27 15:05:26', '2019-09-27 15:05:26', 1),
	(69, '', ':read-write', 1, '表示可由用户编辑的元素\ninput:read-write {\n  background-color: #bbf;\n}\nHack\nfirefox -moz-\nfirefox_android -moz-', '', '', '', '', '2019-09-27 15:08:16', '2019-09-27 15:08:16', 1),
	(70, '', ':required', 1, '表示设置了 required 属性的任何 input，select 或 textarea 元素。\ninput:required {\n  border: 1px dashed red;\n}\n', '', '', '', '', '2019-09-27 15:10:54', '2019-09-27 15:10:54', 1),
	(71, '', ':right', 1, '与 @page 规则一起使用，表示打印文档的所有右侧页面。\n@page :right {\n  margin: 2in 3in;\n}', '', '', '', '', '2019-09-27 15:22:06', '2019-09-27 15:22:06', 1),
	(72, '', ':root', 1, '匹配代表文档的树的根元素。在 HTML 中，:root 表示 html 元素，并且与选择器 html 相同，不同之处在于它的特异性更高。\n:root {\n  background: yellow;\n}', '', '', '', '', '2019-09-27 15:25:16', '2019-09-27 15:25:16', 1),
	(73, '', ':scope', 1, '当从 DOM API（例如 querySelector()，querySelectorAll()，matches() 或 Element.closest()）中使用时，:scope 匹配在其上调用方法的元素。当在样式表中使用时，:scope 与 :root 相同，因为此时尚无办法显式建立作用域元素。\n:scope {\n  background-color: lime;\n}', '', '', '', '', '2019-09-27 15:33:37', '2019-09-27 15:33:37', 1),
	(74, '', ':target', 1, '选择一个 ID 与当前 URL 携带的 # 标志匹配的元素\n:target {\n  border: 2px solid black;\n}\n\n', '', '', '', '', '2019-09-27 15:37:02', '2019-09-27 15:37:02', 1),
	(75, '', ':valid', 1, '选择验证成功的 input 或其它 form 元素\ninput:valid {\n  background-color: powderblue;\n}', '', '', '', '', '2019-09-27 15:39:36', '2019-09-27 15:39:36', 1),
	(76, '', ':valid（适用于 form 元素）', 1, '', '', '', '', '', '2019-09-27 15:41:32', '2019-09-27 15:41:32', 1),
	(77, '', ':visited', 1, '表示用户已经访问过的链接\na:visited {\n  color: green;\n}', '', '', '', '', '2019-09-27 15:43:56', '2019-09-27 15:43:56', 1),
	(78, '', '@charset', 1, '定义样式表使用的字符集\n@charset "utf-8";', '', '', '', '', '2019-09-27 15:50:34', '2019-09-27 15:50:34', 1),
	(79, '', '@import', 1, '用于从其他样式表导入样式规则\n@import url("fineprint.css") print;', '', '', '', '', '2019-09-27 15:52:48', '2019-09-27 15:52:48', 1),
	(80, '', '@namespace', 1, '用于定义要在 CSS 样式表中使用的 XML 命名空间\n@namespace url(http://www.w3.org/1999/xhtml);\n@namespace svg url(http://www.w3.org/2000/svg);\n\n/* 匹配所有 XHTML 的 a 元素, 因为 XHTML 是默认的无前缀名称空间 */\na {}\n\n/* 匹配所有 SVG 的 a 元素 */\nsvg|a {}\n\n/* 匹配 XHTML 和 SVG 的 a 元素 */\n*|a {}', '', '', '', '', '2019-09-27 17:42:49', '2019-09-27 17:42:49', 1),
	(81, '', '@media', 1, '您可以指定一个媒体查询和一个 CSS 块，当且仅当该媒体查询与正在使用其内容的设备匹配时，该 CSS 块才能应用于该文档。\n@media print {}\n@media screen {}\n@media screen, print {}\n@media only screen {}', '', '', '', '', '2019-09-29 10:07:56', '2019-09-29 10:07:56', 1),
