	(83, '', '@media (any-pointer)', 1, '检测是否有定点输入设备，以及输入精度。\n@media (any-pointer: none) {}\n@media (any-pointer: fine) {}\n@media (any-pointer: coarse) {}', '', '', '', '', '2019-09-29 10:33:03', '2019-09-29 10:33:03', 1),
