	(104, '', '@page', 1, '打印文档时，@page CSS 规则用于修改某些 CSS 属性。您不能使用 @page 更改所有 CSS 属性。您只能更改文档的 margins，orphans，widows 和分页符。尝试更改任何其他 CSS 属性将被忽略。\n@page {\n  margin: 1cm;\n}', '', '', '', '', '2019-09-29 13:46:52', '2019-09-29 13:46:52', 1),
	(105, '', '@font-face', 1, '指定自定义字体\n@font-face {\n  font-family: "Open Sans";\n  src: url("/fonts/OpenSans-Regular-webfont.woff2") format("woff2"),\n       url("/fonts/OpenSans-Regular-webfont.woff") format("woff");\n}', '', '', '', '', '2019-09-29 13:49:32', '2019-09-29 13:49:32', 1),
