	(375, '', '<nav>', 1, '表示页面的章节，目的是提供当前文档内或其他文档的导航链接。', '', '', '', '', '2019-10-10 15:01:41', '2019-10-10 15:01:41', 1),
	(376, '', '<section>', 1, '代表一个独立的部分', '', '', '', '', '2019-10-10 15:02:44', '2019-10-10 15:02:44', 1),
	(377, '', '<blockquote>', 1, '表示随附的文本是扩展引号。', '', '', '', '', '2019-10-10 15:04:42', '2019-10-10 15:04:42', 1),
	(378, '', '<dd>', 1, '在描述列表（dl）中提供前一项（dt）的描述，定义或值。', '', '', '', '', '2019-10-10 15:06:53', '2019-10-10 15:06:53', 1),
	(379, '', '<dl>', 1, '表示描述列表', '', '', '', '', '2019-10-10 15:09:36', '2019-10-10 15:09:36', 1),
	(380, '', '<dt>', 1, '指定描述或定义列表中的术语，因此必须在 dl 元素内使用。', '', '', '', '', '2019-10-10 15:11:13', '2019-10-10 15:11:13', 1),
	(381, '', '<div>', 1, '是流内容的通用容器。', '', '', '', '', '2019-10-10 15:12:10', '2019-10-10 15:12:10', 1),
	(382, '', '<figcaption>', 1, '表示说明其父 figure 元素的其余内容的标题或图例。', '', '', '', '', '2019-10-10 15:13:47', '2019-10-10 15:13:47', 1),
	(383, '', '<figure>', 1, '表示独立的内容，可能带有可选的标题，该标题使用（figcaption）元素指定。', '', '', '', '', '2019-10-10 15:14:41', '2019-10-10 15:14:41', 1),
	(384, '', '<hr>', 1, '代表段落级元素之间的主题的断开', '', '', '', '', '2019-10-10 15:16:58', '2019-10-10 15:16:58', 1),
	(385, '', '<li>', 1, '用于表示列表中的项目', '', '', '', '', '2019-10-10 15:17:34', '2019-10-10 15:17:34', 1),
	(386, '', '<ol>', 1, '表示项目的有序列表，通常呈现为编号列表。', '', '', '', '', '2019-10-10 15:18:26', '2019-10-10 15:18:26', 1),
	(387, '', '<p>', 1, '代表一个段落', '', '', '', '', '2019-10-10 15:33:24', '2019-10-10 15:33:24', 1),
	(388, '', '<pre>', 1, '表示要完全按照HTML文件中的格式显示的预格式化文本。', '', '', '', '', '2019-10-10 15:35:09', '2019-10-10 15:35:09', 1),
	(389, '', '<ul>', 1, '表示项目的无序列表，通常呈现为项目符号列表。', '', '', '', '', '2019-10-10 15:35:40', '2019-10-10 15:35:40', 1),
	(390, '', '<a>', 1, '连同其 href 属性一起，创建到其他网页，文件，同一页面中的位置，电子邮件地址或任何其他 URL 的超链接。', '', '', '', '', '2019-10-10 15:37:55', '2019-10-10 15:37:55', 1),
	(391, '', '<abbr>', 1, '代表缩写或首字母缩写', '', '', '', '', '2019-10-10 15:38:48', '2019-10-10 15:38:48', 1),
	(392, '', '<b>', 1, '用来引起读者对元素内容的关注', '', '', '', '', '2019-10-10 15:39:38', '2019-10-10 15:39:38', 1),
	(393, '', '<bdi>', 1, '告诉浏览器的双向算法将其包含的文本与周围的文本隔离。', '', '', '', '', '2019-10-10 15:42:16', '2019-10-10 15:42:16', 1),
	(394, '', '<bdo>', 1, '覆盖文本的当前方向，以便其中的文本以不同的方向渲染', '', '', '', '', '2019-10-10 15:43:22', '2019-10-10 15:43:22', 1),
	(395, '', '<br>', 1, '在文本中产生换行符', '', '', '', '', '2019-10-10 15:44:07', '2019-10-10 15:44:07', 1),
	(396, '', '<cite>', 1, '用于描述对引用的创意作品的引用，并且必须包括该作品的标题。', '', '', '', '', '2019-10-10 15:45:11', '2019-10-10 15:45:11', 1),
	(397, '', '<code>', 1, '以旨在指示文本是计算机代码的简短片段的方式显示其内容的样式。', '', '', '', '', '2019-10-10 15:45:54', '2019-10-10 15:45:54', 1),
	(398, '', '<data>', 1, '将给定的内容与机器可读的翻译链接起来。', '', '', '', '', '2019-10-10 15:47:48', '2019-10-10 15:47:48', 1),
	(399, '', '<dfn>', 1, '用于表示在定义短语或句子的上下文中定义的术语。', '', '', '', '', '2019-10-10 15:48:58', '2019-10-10 15:48:58', 1),
	(400, '', '<em>', 1, '标记强调重点的文本', '', '', '', '', '2019-10-10 15:49:35', '2019-10-10 15:49:35', 1),
	(401, '', '<i>', 1, '表示由于某种原因而偏离普通文本的文本范围。', '', '', '', '', '2019-10-10 15:50:00', '2019-10-10 15:50:00', 1),
	(402, '', '<kbd>', 1, '表示嵌入式文本的跨度，表示从键盘，语音输入或任何其他文本输入设备进行的文本用户输入。', '', '', '', '', '2019-10-10 15:51:29', '2019-10-10 15:51:29', 1),
	(403, '', '<mark>', 1, '表示由于标记的段落在封闭环境中的相关性或重要性而被标记或突出显示的文本，以供参考或标记。', '', '', '', '', '2019-10-10 15:52:35', '2019-10-10 15:52:35', 1),
	(404, '', '<q>', 1, '表示附带的文本是短内联引号。', '', '', '', '', '2019-10-10 15:57:18', '2019-10-10 15:57:18', 1),
	(405, '', '<rb>', 1, '用于分隔 ruby 批注的基础文本组件，即正在注释的文本。', '', '', '', '', '2019-10-10 15:58:55', '2019-10-10 15:58:55', 1),
	(406, '', '<rp>', 1, '用于为不支持使用 ruby 元素显示红宝石批注的浏览器提供后备括号。', '', '', '', '', '2019-10-10 15:59:55', '2019-10-10 15:59:55', 1),
	(407, '', '<rt>', 1, '指定红宝石注释的红宝石文本组件，该组件用于为东亚印刷术提供发音，翻译或音译信息。', '', '', '', '', '2019-10-10 16:00:28', '2019-10-10 16:00:28', 1),
	(408, '', '<rtc>', 1, '包含在 ruby 元素内部使用的 rb 元素的 ruby 中表示的字符的语义注释。', '', '', '', '', '2019-10-10 16:01:24', '2019-10-10 16:01:24', 1),
	(409, '', '<ruby>', 1, '代表 ruby 注释', '', '', '', '', '2019-10-10 16:02:55', '2019-10-10 16:02:55', 1),
	(410, '', '<s>', 1, '呈现带有删除线或通过删除线的文本。', '', '', '', '', '2019-10-10 16:04:09', '2019-10-10 16:04:09', 1),
	(411, '', '<samp>', 1, '用于包围表示计算机程序输出的示例（或引用）的内联文本。', '', '', '', '', '2019-10-10 16:04:55', '2019-10-10 16:04:55', 1),
	(412, '', '<small>', 1, '代表旁注和小字体，例如版权和法律文本，独立于其样式表示。', '', '', '', '', '2019-10-10 16:05:33', '2019-10-10 16:05:33', 1),
	(413, '', '<span>', 1, '是用于表达内容的通用内联容器，它本质上不代表任何内容。', '', '', '', '', '2019-10-10 16:06:07', '2019-10-10 16:06:07', 1),
	(414, '', '<strong>', 1, '表示其内容具有高度重要性，严重性或紧迫性。浏览器通常以粗体显示内容。', '', '', '', '', '2019-10-10 16:13:00', '2019-10-10 16:13:00', 1),
	(415, '', '<sub>', 1, '指定仅出于印刷原因应显示为下标的内联文本。', '', '', '', '', '2019-10-10 16:14:12', '2019-10-10 16:14:12', 1),
	(416, '', '<sup>', 1, '指定仅出于印刷原因而显示为上标的嵌入式文本。', '', '', '', '', '2019-10-10 16:14:35', '2019-10-10 16:14:35', 1),
	(417, '', '<time>', 1, '代表特定时间段。', '', '', '', '', '2019-10-10 16:16:04', '2019-10-10 16:16:04', 1),
	(418, '', '<tt>', 1, '废弃\n创建使用用户代理的默认等宽字体显示的内联文本。', '', '', '', '', '2019-10-10 16:20:24', '2019-10-10 16:20:24', 1),
	(419, '', '<u>', 1, '表示一定范围的内联文本，应以指示其具有非文本注释的方式渲染。', '', '', '', '', '2019-10-10 16:21:15', '2019-10-10 16:21:15', 1),
	(420, '', '<var>', 1, '代表数学表达式或编程上下文中的变量名称。', '', '', '', '', '2019-10-10 16:21:47', '2019-10-10 16:21:47', 1),
	(421, '', '<wbr>', 1, '代表一个分词机会', '', '', '', '', '2019-10-10 16:23:08', '2019-10-10 16:23:08', 1),
	(422, '', '<area>', 1, '在图像上定义一个热点区域，并有选择地将其与超文本链接相关联。', '', '', '', '', '2019-10-10 16:24:49', '2019-10-10 16:24:49', 1),
	(423, '', '<audio>', 1, '用于将声音内容嵌入文档中。', '', '', '', '', '2019-10-10 16:25:51', '2019-10-10 16:25:51', 1),
	(424, '', '<img>', 1, '将图像嵌入到文档中。', '', '', '', '', '2019-10-10 16:26:40', '2019-10-10 16:26:40', 1),
	(425, '', '<map>', 1, '与 area 元素一起使用以定义图像映射', '', '', '', '', '2019-10-10 16:27:33', '2019-10-10 16:27:33', 1),
	(426, '', '<track>', 1, '用作媒体元素 audio 和 video 的子元素', '', '', '', '', '2019-10-10 16:29:05', '2019-10-10 16:29:05', 1),
	(427, '', '<video>', 1, '将支持视频播放的媒体播放器嵌入到文档中。', '', '', '', '', '2019-10-10 16:31:34', '2019-10-10 16:31:34', 1),
	(428, '', '<applet>', 1, '废弃\n将Java小程序嵌入文档中', '', '', '', '', '2019-10-10 16:33:14', '2019-10-10 16:33:14', 1),
	(429, '', '<embed>', 1, '将外部内容嵌入到文档中的指定点。', '', '', '', '', '2019-10-10 16:34:19', '2019-10-10 16:34:19', 1),
