	(439, '', '<del>', 1, '表示已从文档中删除的文本范围。', '', '', '', '', '2019-10-10 16:55:32', '2019-10-10 16:55:32', 1),
	(440, '', '<ins>', 1, '表示已添加到文档中的文本范围。', '', '', '', '', '2019-10-10 16:56:05', '2019-10-10 16:56:05', 1),
	(441, '', '<caption>', 1, '指定表格的标题', '', '', '', '', '2019-10-10 16:57:37', '2019-10-10 16:57:37', 1),
	(442, '', '<col>', 1, '在表中定义一列，用于定义所有公共单元格上的公共语义。', '', '', '', '', '2019-10-10 16:58:22', '2019-10-10 16:58:22', 1),
	(443, '', '<colgroup>', 1, '定义表中的一组列', '', '', '', '', '2019-10-10 16:58:50', '2019-10-10 16:58:50', 1),
