	(446, '', '<td>', 1, '定义包含数据的表的单元格', '', '', '', '', '2019-10-10 17:02:21', '2019-10-10 17:02:21', 1),
	(447, '', '<tfoot>', 1, '定义汇总表列的一组行。', '', '', '', '', '2019-10-10 17:02:50', '2019-10-10 17:02:50', 1),
	(448, '', '<th>', 1, '将单元格定义为一组表单元格的标题。', '', '', '', '', '2019-10-10 17:03:24', '2019-10-10 17:03:24', 1),
	(449, '', '<thead>', 1, '定义一组行，定义表中列的标题。', '', '', '', '', '2019-10-10 17:03:49', '2019-10-10 17:03:49', 1),
