	(462, '', '<progress>', 1, '显示任务完成进度的指示器，通常显示为进度条。', '', '', '', '', '2019-10-10 17:26:01', '2019-10-10 17:26:01', 1),
	(463, '', '<select>', 1, '表示提供选项菜单的控件', '', '', '', '', '2019-10-10 17:27:48', '2019-10-10 17:27:48', 1),
	(464, '', '<textarea>', 1, '表示多行纯文本编辑控件，当您希望允许用户输入大量自由格式文本（例如对审阅或反馈表单的评论）时，该控件非常有用。', '', '', '', '', '2019-10-10 17:28:48', '2019-10-10 17:28:48', 1),
	(465, '', '<details>', 1, '创建一个公开小部件，其中的信息仅在小部件切换到“打开”状态时才可见。', '', '', '', '', '2019-10-10 17:31:11', '2019-10-10 17:31:11', 1),
	(466, '', '<dialog>', 1, '表示对话框或其他交互组件，如检查器或窗口', '', '', '', '', '2019-10-10 17:35:08', '2019-10-10 17:35:08', 1),
	(467, '', '<menu>', 1, '表示用户可以执行或激活的一组命令', '', '', '', '', '2019-10-10 17:36:31', '2019-10-10 17:36:31', 1),
	(468, '', '<menuitem>', 1, '废弃\n表示用户可以通过弹出菜单调用的命令', '', '', '', '', '2019-10-10 17:37:02', '2019-10-10 17:37:02', 1),
	(469, '', '<summary>', 1, '为 details 元素的公开框指定摘要、标题或图例', '', '', '', '', '2019-10-10 17:38:35', '2019-10-10 17:38:35', 1),
	(470, '', '<slot>', 1, 'Web Components 技术套件的一部分。是 Web Component 中的一个占位符，您可以用自己的标记填充它，它允许您创建单独的 dom 树并将它们一起渲染。', '', '', '', '', '2019-10-10 17:41:05', '2019-10-10 17:41:05', 1),
	(471, '', '<template>', 1, '一种保存 html 的机制，在加载页面时不会立即渲染，但在运行时可以使用 javascript 随后实例化。', '', '', '', '', '2019-10-10 17:42:24', '2019-10-10 17:42:24', 1),
	(472, '', '<acronym>', 1, '废弃\n允许作者清楚地指示组成单词缩写或缩写的字符序列。', '', '', '', '', '2019-10-10 17:55:27', '2019-10-10 17:55:27', 1),
	(473, '', '<basefont>', 1, '废弃\n为从其父元素派生的其他元素设置默认字体、大小和颜色', '', '', '', '', '2019-10-10 17:57:37', '2019-10-10 17:57:37', 1),
	(474, '', '<bgsound>', 1, '废弃\n为从其父元素派生的其他元素设置默认字体、大小和颜色', '', '', '', '', '2019-10-10 17:57:47', '2019-10-10 17:57:47', 1),
	(475, '', '<content>', 1, '废弃\n被 slot 元素替代', '', '', '', '', '2019-10-10 17:58:15', '2019-10-10 17:58:15', 1),
	(476, '', '<big>', 1, '废弃\n以比周围文本大一级的字体大小渲染封闭文本', '', '', '', '', '2019-10-10 17:59:09', '2019-10-10 17:59:09', 1),
	(477, '', '<center>', 1, '废弃\n块级元素，显示其块级或内联内容，水平居中于其包含元素中。', '', '', '', '', '2019-10-10 18:01:01', '2019-10-10 18:01:01', 1),
	(478, '', '<font>', 1, '废弃\n定义其内容的字体大小、颜色和字体', '', '', '', '', '2019-10-10 18:03:03', '2019-10-10 18:03:03', 1),
	(479, '', '<frame>', 1, '废弃\n一种HTML元素，它定义一个特定的区域，在该区域中可以显示另一个HTML文档。', '', '', '', '', '2019-10-10 18:03:39', '2019-10-10 18:03:39', 1),
	(480, '', '<frameset>', 1, '废弃\n用于包含 frame 元素', '', '', '', '', '2019-10-10 18:04:13', '2019-10-10 18:04:13', 1),
	(481, '', '<marquee>', 1, '废弃\n用于插入文本的滚动区域', '', '', '', '', '2019-10-10 18:05:37', '2019-10-10 18:05:37', 1),
	(482, '', '<nobr>', 1, '废弃\n防止包含的文本自动换行，这可能导致用户必须水平滚动才能看到文本的整个宽度。', '', '', '', '', '2019-10-10 18:08:34', '2019-10-10 18:08:34', 1),
