	(511, '', 'translate', 1, '是一个枚举属性，用于指定在本地化页时是否应转换元素的可翻译属性值及其文本节点子级，或是否保持它们不变。', '', '', '', '', '2019-10-10 19:35:47', '2019-10-10 19:35:47', 1),
	(512, '', '<html>manifest', 1, '废弃\n指定指示应在本地缓存的资源的资源清单的uri。', '', '', '', '', '2019-10-11 09:04:43', '2019-10-11 09:04:43', 1),
