	(571, '', '<input type="datetime-local">', 1, '创建输入控件，使用户可以轻松地输入日期和时间，包括年、月和日，以及以小时和分钟为单位的时间。', '', '', '', '', '2019-10-11 16:08:32', '2019-10-11 16:08:32', 1),
